Header:
    version: "4"
StyleSheets:
-   selector: ".red-mark"
    properties:
        bg-frame: 1
-   selector: ".queue #ListLine"
    properties:
        visible: false
-   selector: ".queue #LeftLine"
    properties:
        anchor-topAnchor: 40.000000
-   selector: ".right-red-icon #icon"
    properties:
        bg-frame: 2
        scale: [1.000000, 1.000000]
-   selector: "#VehicleName"
    properties:
        text-textalign: ["LEFT", "TOP"]
-   selector: ".ready:pressed_inside #back"
