        bg-spriteModification: ["FLIP_HORIZONTAL"]
-   selector: ".set-vertical-size"
    properties:
        sizePolicy-verticalPolicy: "FixedSize"
        sizePolicy-verticalValue: 64.000000
-   selector: ".queue-invite #LeftLine"
    properties:
        anchor-topAnchor: 120.000000
-   selector: ".queue #TraineeList"
