        bg-color: [1.000000, 1.000000, 1.000000, 0.392157]
-   selector: ".right-to-left ? #VehicleIcon"
    properties:
        anchor-leftAnchor: 0.000000
        anchor-leftAnchorEnabled: true
        anchor-rightAnchor: 0.000000
        anchor-rightAnchorEnabled: false
        scale: [1.000000, 1.000000]
-   selector: ".queue-invite #RightLine"
    properties:
        anchor-topAnchor: 120.000000
-   selector: ".observer-button-team #mode, .observer-team ? #ObserverMode"
    properties:
        bg-frame: 1
-   selector: ".observer-button-both #mode, .observer-both ? #ObserverMode"
    properties:
        bg-frame: 0
-   selector: ".not-ready #VehicleName"
    properties:
        text-textColor: [0.627451, 0.600000, 0.800000, 0.941176]
-   selector: ".left-to-right ? #ObserverMode"
    properties:
        anchor-leftAnchorEnabled: false
        anchor-rightAnchorEnabled: true
-   selector: ".map-white-back"
    properties:
        bg-color: [1.000000, 1.000000, 1.000000, 0.600000]
        bg-drawType: "DRAW_FILL"
        bg-colorInherit: "COLOR_ADD_TO_PARENT"
